INSERT INTO `pages` (`id`, `link`, `naslov`, `tekst`, `date_modified`, `seo_url`) VALUES
(1, 'Contact', 'Contacts', 'E-mail: bet@zinteo.com', '2013-11-14 01:13:20', 'contacts'),
(2, 'About', 'About Zinteo', '&lt;div&gt;\n &lt;div&gt;\n  Zinteo is Global Social Betting Network - a place where bettors from all around the world can compete to each other on real sport matches.&lt;/div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  All bets are money-free.&amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  Most succesfull bettors can earn money and other awards.&lt;br /&gt;\n  &lt;br /&gt;\n  &lt;a class="zolto" href="http://zinteo.wordpress.com/" target="_blank"&gt;More about Zinteo, on Zinteo Blog.&lt;/a&gt;&lt;br /&gt;\n  &amp;nbsp;&lt;/div&gt;\n&lt;/div&gt;\n&lt;br /&gt;', '2014-01-25 19:18:52', 'about-zinteo'),
(3, 'Rules', 'Rules and Description', '&lt;div&gt;\n Everyone can put money-free bets, on real matches, with real coefficients.&lt;/div&gt;\n&lt;div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  Everyone starts with 100 points.&lt;/div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  List of tippers and their points saldo is shown on Leaderboard page&lt;/div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  Tippers can follow up to 5 other tippers, for free.&lt;/div&gt;\n &lt;div&gt;\n  &amp;nbsp;&lt;/div&gt;\n &lt;div&gt;\n  Available matches are from all around the world, from different sports.&amp;nbsp;&lt;/div&gt;\n&lt;/div&gt;\n&lt;br /&gt;', '2013-11-14 01:19:11', 'rules-and-description'),
(4, 'Awards', 'Awards', 'Awards can be different.&lt;br /&gt;\n&lt;br /&gt;\nFrom free tickets to real bettiing stores, to tickets for real sport games, to real money income to your bank account.&lt;br /&gt;\n&lt;br /&gt;\nAll you need to to is be as good as possible tipper.&amp;nbsp;&lt;br /&gt;\n&lt;br /&gt;\nAwards for February 2013, are\n&lt;ul&gt;\n &lt;li&gt;\n  1.000 MKD denars for tipper of the month&lt;/li&gt;\n &lt;li&gt;\n  500 MKD denars for every tipper of the week&lt;/li&gt;\n&lt;/ul&gt;', '2014-02-01 16:33:19', 'awards'),
(5, 'Invite', 'Why Invite Friends', '&lt;div&gt;\n By inviting friends, you can be able to bet more matches on Zinteo.&lt;br /&gt;\n &lt;br /&gt;\n Every friend from Facebook that is invited earns one more match to bet per day, forever.&lt;/div&gt;', '2013-11-14 01:08:44', 'why-invite-friends'),
(6, 'Checkout', 'Title for checkout', '&lt;strong&gt;There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&amp;#39;t look even slightly believable.&lt;/strong&gt;&lt;br /&gt;\n&lt;br /&gt;\nIf you are going to use a passage of Lorem Ipsum, you need to be sure there isn&amp;#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', '2013-11-11 17:21:27', 'title-for-checkout'),
(7, 'Rate', 'Title for rate', '&lt;strong&gt;There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&amp;#39;t look even slightly believable.&lt;/strong&gt;&lt;br /&gt;\n&lt;br /&gt;\nIf you are going to use a passage of Lorem Ipsum, you need to be sure there isn&amp;#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', '2013-11-11 17:21:31', 'title-for-rate'),
(12, '', 'Blog', 'Mora about Zinteo on our blog. At the moment, there are English and Macedonian language versions of the blog.&amp;nbsp;&lt;br /&gt;\n&lt;br /&gt;\nEnglish Zinteo Blog&lt;br /&gt;\n&lt;a class="zolto" href="http://zinteo.wordpress.com/" target="_blank"&gt;http://zinteo.wordpress.com/&lt;/a&gt;&lt;br /&gt;\n&lt;br /&gt;\nMacedonian Zinteo Blog&lt;br /&gt;\n&lt;a class="zolto" href="http://zinteomacedonia.wordpress.com/" target="_blank"&gt;http://zinteomacedonia.wordpress.com/&lt;/a&gt;', '2014-02-04 17:08:08', 'blog'),
(8, 'Promo', 'Promo', 'Promo cod can be used to gain more matches to bet. Ask for promo code, now!', '2014-01-25 19:23:34', 'promo'),
(11, '', 'Zinteo on Facebook', 'Zinteo Official Facebook Page&lt;br /&gt;\n&lt;a class="zolto" href="https://www.facebook.com/pages/Zinteo/606395856085070"&gt;https://www.facebook.com/pages/Zinteo/606395856085070&lt;/a&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;', '2014-01-25 19:23:04', 'zinteo-on-facebook');
